import { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  constructor(){
    super();
    this.state = {
      name: { firstName: 'Logan', lastName: 'Bruesehoff'},
      company: 'MultiTech',
    };
  }

  render() {
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <p>Hello {this.state.firstName} {this.state.lastName}. I work at {this.state.company} </p>
          <button 
            onClick={() => {
              this.setState({ name: {firstName: 'Katieann'}});
            }}>
            Change Name
          </button>
        </header>
      </div>
    );
  }
}

export default App;
